### Example 1: Hardcoded strings in JavaScript code

In a library or book order platform, you might have a JavaScript function that displays a success message when an order is placed. However, if the message is hardcoded, it will not be translatable.

```javascript
// Non-i18n compliant code
function displaySuccessMessage() {
  alert("Order placed successfully!");
}
```

**I18n Violation:** The hardcoded string "Order placed successfully!" is not translatable.

**Fix:** Use a translation library like i18next or a simple translation object to store translatable strings.

```javascript
// i18n compliant code
const translations = {
  en: {
    orderPlaced: "Order placed successfully!",
  },
  fr: {
    orderPlaced: "Commande passée avec succès!",
  },
};

function displaySuccessMessage(language) {
  const translation = translations[language].orderPlaced;
  alert(translation);
}
```

**Best Practice:** Use a separate file for translations and load them dynamically based on the user's language preference.

### Example 2: Inconsistent file structure

In a large project, it's common to have multiple files with similar functionality. However, if the file structure is inconsistent, it can lead to i18n issues.

```javascript
// Non-i18n compliant code
// File structure:
// components/
//   OrderButton.js
//   OrderForm.js
//   OrderSummary.js
// translations/
//   en.json
//   fr.json
```

